import {Navigate, Routes, Route, Link, useLocation } from "react-router-dom";


const Home = () => {

    const ToRegister =  () => {

        return  <Link to={"/home"}/>

    }

  return (
    <div className="container">
      <header className="jumbotron">
        <h3>hello</h3>
        <div>
            <h4>if you want to register click below</h4>
            <button onClick={  <ToRegister/> }>click me</button>
        </div>
      </header>
    </div>
  );
};

export default Home;
